import React from 'react';
import './Glass.css';

const Glass = () => {
    return (
        <div className="glass-effect">
            <h1>유리창 효과</h1>
            <p>이것은 반투명 유리창 효과를 적용한 박스입니다.</p>
        </div>
    );
}

export default Glass;
